import React, { useEffect, useState, useCallback, useMemo } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Cart = () => {
  const [cartItems, setCartItems] = useState([]);
  const [totalPrice, setTotalPrice] = useState(0);
  const navigate = useNavigate();

  const user_data = useMemo(() => {
    const user_id = sessionStorage.getItem("user_id");
    if (!user_id) {
      console.error("User ID not found in sessionStorage.");
      navigate("/login"); // Redirect to login if user_id is missing
    }
    return { user_id };
  }, [navigate]);

  const fetchCart = useCallback(async () => {
    try {
      const response = await axios.post(
        "http://localhost:8000/medical_store_app/cart/",
        user_data
      );
      if (response.data) {
        setCartItems(response.data.cart_items || []);
        setTotalPrice(response.data.total_price || 0);
      }
    } catch (error) {
      console.error("Error fetching cart items:", error);
    }
  }, [user_data]);

  useEffect(() => {
    fetchCart();
  }, [fetchCart]);

  const handleRemoveFromCart = async (cartId) => {
    try {
      const user_id = sessionStorage.getItem("user_id");
      if (!user_id) {
        console.error("User ID not found in sessionStorage.");
        navigate("/login");
        return;
      }

      await axios.post(
        `http://localhost:8000/medical_store_app/cart/remove/${cartId}/${user_id}`
      );
      fetchCart();
    } catch (error) {
      console.error("Error removing cart item:", error);
    }
  };

  const handleProceedToCheckout = async () => {
    try {
      const response = await axios.post(
        "http://localhost:8000/medical_store_app/create_order/",
        user_data
      );
      if (response.data && response.data.order) {
        navigate("/checkout", {
          state: { order: response.data.order, totalPrice },
        });
      } else {
        console.error("Failed to create an order.");
      }
    } catch (error) {
      console.error("Error booking order:", error);
    }
  };

  const handleContinueShopping = () => {
    navigate("/UserProductViews");
  };

  return (
    <div style={styles.container}>
      <button
        style={styles.continueShoppingButton}
        onClick={handleContinueShopping}
      >
        Continue Shopping
      </button>
      <h1 style={styles.heading}>Your Cart</h1>
      <table style={styles.table}>
        <thead>
          <tr>
            <th style={styles.tableHeader}>Medicine</th>
            <th style={styles.tableHeader}>Quantity</th>
            <th style={styles.tableHeader}>Actions</th>
          </tr>
        </thead>
        <tbody>
          {cartItems.length > 0 ? (
            cartItems.map((item, index) => (
              <tr key={index}>
                <td>{item.medicine?.name || "Unknown Medicine"}</td>
                <td>{item.quantity || 0}</td>
                <td>
                  <button
                    onClick={() => handleRemoveFromCart(item.id)}
                    style={styles.button}
                  >
                    Remove
                  </button>
                </td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="3" style={styles.emptyMessage}>
                Your cart is empty.
              </td>
            </tr>
          )}
        </tbody>
      </table>
      <h3 style={styles.total}>Total: ₹{totalPrice}</h3>
      {cartItems.length > 0 && (
        <div style={styles.BookContainer}>
          <button
            style={styles.paymentButton}
            onClick={handleProceedToCheckout}
          >
            Proceed to Booking
          </button>
        </div>
      )}
    </div>
  );
};

const styles = {
  container: {
    padding: "70px",
    fontFamily: "Arial, sans-serif",
  },
  continueShoppingButton: {
    backgroundColor: "#4CAF50",
    color: "white",
    border: "none",
    padding: "10px 20px",
    fontSize: "1rem",
    borderRadius: "5px",
    cursor: "pointer",
  },
  heading: {
    textAlign: "center",
    fontSize: "2rem",
    marginBottom: "20px",
  },
  table: {
    width: "100%",
    borderCollapse: "collapse",
    marginBottom: "20px",
  },
  tableHeader: {
    backgroundColor: "#f4f4f4",
    padding: "10px",
    textAlign: "left",
    fontWeight: "bold",
  },
  button: {
    backgroundColor: "#ff4d4d",
    color: "white",
    border: "none",
    padding: "5px 10px",
    borderRadius: "5px",
    cursor: "pointer",
  },
  total: {
    fontSize: "1.5rem",
    textAlign: "right",
    marginTop: "20px",
    fontWeight: "bold",
  },
  emptyMessage: {
    textAlign: "center",
    padding: "20px",
    color: "gray",
  },
  BookContainer: {
    display: "flex",
    justifyContent: "center",
    marginTop: "20px",
  },
  paymentButton: {
    backgroundColor: "#4CAF50",
    color: "white",
    border: "none",
    padding: "10px 20px",
    fontSize: "1rem",
    borderRadius: "5px",
    cursor: "pointer",
  },
};

export default Cart;
